import base64
import json


class F_STATE_GENERATOR:
    def __init__(self):
        self.F_STATE_template = ''

    def _decode_base64(self, data):
        missing_padding = 4 - len(data) % 4
        if missing_padding:
            data += '=' * missing_padding
        return str(base64.b64decode(data), encoding='utf-8')

    def _encode_base64(self, data):
        bytes_data = data.encode("utf-8")
        return (base64.b64encode(bytes_data)).decode()

    # def date_cal(self):

    def updated_F_STATE(self, t, ZAIXIAO, XIAN, NAME, tText):
        p1_Title = NAME + "的每日一报"  # 姓名（学号）的每日一报
        F_STATE_read = self._decode_base64(self.F_STATE_template)
        F_STATE_dict = json.loads(F_STATE_read)
        F_STATE_dict.get('p1_BaoSRQ').update({'Text': t.strftime('%Y-%m-%d')})
        F_STATE_dict.get('p1_ShiFZX').update({'SelectedValue': "是"})
        F_STATE_dict.get('p1_ddlXian').update({'SelectedValueArray': [XIAN]})
        F_STATE_dict.get('p1').update({'Title': p1_Title})
        F_STATE_dict.get('p1_FengXDQDL').update({'Label': tText + "是否在<span style='color:red;'>中高风险地区</span>逗留"})
        F_STATE_dict.get('p1_TongZWDLH').update(
            {'Label': "上海同住人员是否有" + tText + "来自<span style='color:red;'>中高风险地区</span>的人"})
        F_STATE_dict.get('p1_CengFWH').update({'Label': tText + "是否在<span style='color:red;'>中高风险地区</span>逗留过"})
        F_STATE_dict.get('p1_JieChu').update({'Label': tText + "是否与来自<span style='color:red;'>中高风险地区</span>发热人员密切接触"})
        F_STATE_dict.get('p1_TuJWH').update({'Label': tText + "是否乘坐公共交通途径<span style='color:red;'>中高风险地区</span>"})
        F_STATE_dict.get('p1_JiaRen').update({'Label': tText + "家人是否有发热等症状"})

        updated_F_STATE_str = json.dumps(F_STATE_dict, ensure_ascii=False, separators=(',', ':'))
        return self._encode_base64(updated_F_STATE_str)


if __name__ == '__main__':
    import datetime as dt
    t = dt.datetime.utcnow()
    t = t + dt.timedelta(hours=8)
    t2 = t - dt.timedelta(+14)
    tText = t2.strftime('%m月%d日') + '至' + t.strftime('%m月%d日')
    ZAIXIAO = "延长"  # 宝山、嘉定或延长
    XIAN = "静安区"  # 宝山区、嘉定区或静安区
    NAME = "11111111（老陈）"  # 姓名（学号）
    F_STATE_GENERATOR().updated_F_STATE(t, ZAIXIAO, XIAN, NAME, tText)
